    }

    componentWillMount = async () => {
        let attendAuctionsNum = await this.props.NFTContract.methods.attendAuctionsNum(this.props.accountAddress).call();
        this.setState({attendAuctionsNum});
        console.log("mount");
    }

    componentDidMount() {
